import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3 17h12a1 1 0 01.12 2H3a1 1 0 01-.12-2H15 3zm0-4h18a1 1 0 01.12 2H3a1 1 0 01-.12-2H21 3zm0-4h18a1 1 0 01.12 2H3a1 1 0 01-.12-2H21 3zm0-4h18a1 1 0 01.12 2H3a1 1 0 01-.12-2H21 3z", fill: primaryFill }));
};
const TextDescription24Filled = wrapIcon(rawSvg({}), 'TextDescription24Filled');
export default TextDescription24Filled;
